	rfidLabel.place(x=90,y=60)
	s4 = Spinner4(rfidWindow, size=48)
	s4.place(x=140,y=100)


	authenticated_customer = "Harshal Mandlekar"

	btn1.config(text=authenticated_customer,bg="#07db3f")
	btn2["state"] = "normal"


